import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a modal: Click on the first product card (simulate product detail modal open)
    // Use a selector that finds a product card by class and index
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for modal to appear (modal has id 'productModal' and style.display = 'block')
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible (style.display !== 'none')
    await page.waitForFunction(() => {
      const el = document.getElementById('productModal');
      return el && window.getComputedStyle(el).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot with modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Send Escape key to close modal
    await page.keyboard.press('Escape');

    // Wait for modal to be hidden (style.display === 'none')
    await page.waitForFunction(() => {
      const el = document.getElementById('productModal');
      return el && window.getComputedStyle(el).display === 'none';
    }, { timeout: 5000 });

    // Take screenshot after closing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data to verify modal is closed
    const modalDisplay = await page.evaluate(() => {
      const el = document.getElementById('productModal');
      return el ? window.getComputedStyle(el).display : null;
    });

    return {
      success: true,
      action: "Opened product modal, closed it with Escape key, and verified modal is hidden.",
      extractedData: {
        modalDisplay
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
